INSERT INTO `pc_gw` VALUES ('4', '1', '12123', '123123', '2', '0', '教育愿景', '0', '教育愿景', 'Educational Vision', '123123', '                <p>\r\n                    音樂是一種最好的全人教育，為孩子打開寬闊的視野，讓孩子全方位探索；從練習的過程和別人搭配演奏的互動，乃至於整體演出的團隊默契培養，從中培養孩子自動自發的學習、獨立自主的性格、人我互動的應對，敲出節奏感，也同時擊出秩序、美與和諧並開啟每一個孩子的無限潛能。\r\n                </p>\r\n                <p>\r\n                    所以在創辦這套系統時，我特別強調音樂只是一種學習媒介，如何透過音樂來達成四大特點的全方位人格教育，及如何運用音樂五覺來提升孩子的專注力、理解力、記憶力，是我從事音樂教育近30年來，最期盼從臺灣帶來給中國孩子們的教育理念。\r\n                </p>\r\n                <p>\r\n                    我真心期待能透過我們的系統引領更多的孩子們在這個充滿機遇的世界裡探索，並茁壯成長為有創造力、節奏感、合群性以及高成就的優秀領導者,在我們提供孩子們學習機會的同時，也為他們建立對未來的認知，好讓他們適應社會的日新月異，探索不同領域。此外，我們也要成為地球村不同國籍、不同語言、不同文化的樞紐，通過藝術和人文的交流，激發孩子們的創造潛能，讓我們的下一代能打破地域的界限，建立一個更美好的世界，一個能讓他們健康成長、發光發熱的世界。\r\n                </p>', '/images/about_us_ceo.png', '', '', '', null, null, null, '2018-08-30', '2018-08-31', '1', '0', null, null, '2018-08-16 10:41:49', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('5', '1', '', '', '234', '0', '品牌简介', '1', '品牌简介', 'Brand Introduction', '', '玫苓（厦门）教育服务有限公司旗下品牌 Holistic玫苓全人音乐教学系统，创始于西年1992年，是集课程开发与音乐教学设计于一体，经营2-18岁以上的打击器乐教学（包括木琴、马林巴、铁琴、邦哥鼓、康加鼓、非洲鼓、爵士鼓等超过40种以上乐器），拥有六大国际认证课程，是亚洲地区唯一通过英国权威ITA国际组织ISO9001认证，汇聚音乐美学与完整人格兼具的国际优质教学系统。教学足迹已遍及台湾、美国、日本、新加坡、马来西亚、维也纳、奥地利等多个国家及地区，2015年由台湾正式进入中国大陆。', '/images/about_us_home1.png', '', '', '', null, null, null, null, null, '1', '1', null, null, '2018-08-18 11:36:52', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('6', '1', null, null, '23', '0', '品牌简介', '1', '品牌简介', 'Brand Introduction', null, '创办品牌的25年来，一群执着音乐教育，理念一致的事业伙伴凭借扎实音乐基础与国际击乐大师Chalo Eduardo的全力指导，完美的将西方优势与中方的观念相结合，取其精华去芜存菁，创设出一套真正适合亚洲人的音乐教学系统，希望它能为孩子建立自信，树立正确价值观。用教育的底，来为孩子奠基圆融宽广的学习平台，底子厚，不论孩子日后到底选择那一条路，都能悠游自得，理性与感性平衡发展。2015年，品牌总监Sherry老师将这套完善的教学系统引入中国，Holistic玫苓全人音乐教学系统承续Holistic（全人）音乐的经营理念，带着超过10年以上教龄的师资团队及合法立案的教室设备，为中国孩子提供更好的教学环境保驾护航，继续努力造福更多孩子，让其发光发亮!', '/images/about_us_home2.png', null, null, null, null, null, null, null, null, '1', '2', null, null, null, null, null);
