INSERT INTO `pc_gw` VALUES ('8', '1', null, null, '24', '0', '品牌历程', '1', '品牌的诞生1', '品牌的诞生1', null, ' <p>\r\n                                    人的一生，在舞台上的时光有限，多数的时候，置身台下，是社会中的一员，如何与自己相处，与别人互动是每个学音乐的人的人生课题，因此如何在音乐学习过程同时兼得人格熏陶，值得大家来关心。\r\n                                </p>\r\n                                <p>\r\n                                    在这样的理念感召下，将1992年创办的台湾打击乐教学系统于2015年引入内地,让更多喜欢音乐的的父母,孩子受益.\r\n                                </p>', '/images/Brand_History_img.png', null, null, null, null, null, null, '1992-01-01', '1992-12-31', '1', '1', '2018-08-11 17:27:27', null, null, null, null);
