INSERT INTO `pc_gw` VALUES ('13', '1', null, null, '23', '0', '顾问', '1', '击乐顾问', ' C.G. Ryche', null, '<p>\r\n                            拥有「梦幻编曲者」<br /> 「新型态打击乐者」\r\n                            <br /> 称号的美籍击乐大师\r\n                            <br /> 迪斯尼/Nike/皮克斯/PBS电视台\r\n                            <br /> 指定合作音乐家\r\n                            <br /> 担任Georganne Gould/Benise<br /> 等多位艺人音乐总监\r\n                            <br /> 受邀 Mavric Awards颁奖演出<br />\r\n                        </p>', '/images/guwen-_01.png', null, null, null, null, null, null, null, null, '1', '1', null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('14', '1', null, null, '42', '0', '顾问', '1', '击乐顾问', 'Jimmie Morales', null, '<p>\r\n                            国际击乐拉丁乐大师<br /> 拉丁美洲 Best Conga Player<br /> Remo康加鼓指定代言人\r\n                            <br /> 世界知名Willie Rosario乐团<br /> 专业康加鼓鼓手\r\n                            <br /> 巡演/讲座足迹遍满全世界\r\n                            <br /> 包括欧洲/美洲/亚洲\r\n                            <br />\r\n                        </p>', '/images/guwen-_03.png', null, null, null, null, null, null, null, null, '1', '2', null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('15', '1', null, null, '34', '0', '顾问', '1', '击乐顾问', '小林 義隆', null, ' <p>\r\n                            专业传统太鼓音乐大师<br /> 男鹿嶋 なまはげ乡神乐 团长<br /> 受邀参加美国/法国/中国/韩国\r\n                            <br /> 等国的国家级演出\r\n                            <br /> 『韩国首尔国际鼓乐节』 <br /> 人气投票第一名\r\n                            <br />\r\n                        </p>', '/images/guwen-_05.png', null, null, null, null, null, null, null, null, '1', '3', null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('16', '1', null, null, '23', '0', '顾问', '1', '音乐顾问', ' Katia Moraes', null, '<p>\r\n                            知名巴西歌手，曾与许多艺术家一同演出，她美妙的歌声也曾为电影做配乐，在巴西、美国等国家深受观众喜爱。<br/> 集天籁歌声、诗人的心、教育家热情及表演者的美于一身的Katia大师，实为巴西音乐中最具代表性的歌手。\r\n                        </p>', '/images/guwen-_07.png', null, null, null, null, null, null, null, null, '1', '4', null, null, null, null, null);
