INSERT INTO `pc_gw` VALUES ('30', '2', '', '', '867', '1', '核心优势', '1', '研发', 'DEVELOPMENT', '', '<p class=\"advan_d\" style=\"margin-top: 20px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; color: rgb(89, 87, 87);\">超过25年教学沉淀的梅苓教学系统，在台湾拥有专业权威的国际研发团队，来自世界各地的国际击乐大师，将教授经验与实践所得相凝聚，研发成教学精华流芳百世。研发编撰了<span style=\"color: rgb(253, 208, 0); font-weight: bold;\">近百套有连贯性，又有独立性的绘本教材及音像制品，针对不同年龄段、不同基础的学者提供优质的教材，不仅能够满足超长学龄跨度的适龄需求</span>，可供持续教学，对应的阶段性课程还能够满足音乐基础不一的学者使用，提升了区别于同质化市场的竞争实力。</p><p class=\"advan_d\" style=\"margin-top: 20px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; color: rgb(89, 87, 87);\">Holistic玫苓全人音乐的教学研发不断巩固、更新和完善，使教学研发成果无法被轻易复制，教学成效更是受到了教育市场中各大平台的认可与青睐，为品牌的核心体系打下了殷实的基础。</p>', '/images/advantage_1.png', '/images/advan_img_1.png', '', '', null, null, null, null, null, '1', null, null, null, '2018-08-19 23:12:58', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('31', '2', null, null, '86', '1', '核心优势', '1', '生产', 'PRODUCTION', null, '<p >\r\n                                Holistic玫苓全人音乐是<span>目前国内乐器种类最齐全的音乐教育品牌</span>汇聚美国、德国、日本、台湾等世界级资深的设计生产商，生产的成果拥有Holistic玫苓全人音乐官方授权指定商标。\r\n                            </p>\r\n                            <p >\r\n                                从符合乐器多元的发声渠道、人体操作特性等原理设计，到器乐造型呈现的视觉美化，再到材质严格筛选和精准的规格测量，每一个细节的精心把控都诠释了对高品质的追求目标，致力于为Holistic玫苓全人音乐生产专属高品质教具及乐器，执着于用质量优秀的教具和乐器来匹配卓越的教材，打造源源不断的生产链，<span>彻底打破音乐教育培训机构难以自给自足的经营现状，是满足未来品牌乐器零售需求的坚强后盾。</span>\r\n                            </p>', '/images/advantage_2.png', '/images/advan_img_2.png', null, null, null, null, null, null, null, '1', null, null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('32', '2', null, null, '7', '1', '核心优势', '1', '培训', 'Training', null, '<p >\r\n                                <span>\r\n                                   强大的师资团队由世界各国的顶级音乐家组成，拥有完整的师资培训复制体系,\r\n                               </span> 每年为讲师提供最前沿的教学培训及教学质量把控，帮助讲师领悟教材的精髓，传授教具及乐器完美运用在教学中的技巧。\r\n                            </p>\r\n                            <p >\r\n                                专业的师资培训不但能让教材研发、乐器生产与教学师资无缝衔接的结合于一体，真正的将教学理论落实，更重要的是能够让专修不同类别的音乐教师们也能深入到Holistic玫苓全人音乐的教学体系中，达成全人教育理念的共鸣，创造自我价值的提升，从而实现培训一体化教学质量的保证，为品牌各渠道的合作需求提供教学质量稳固的师资输送。\r\n                            </p>', '/images/advantage_3.png', '/images/advan_img_3.png', null, null, null, null, null, null, null, '1', null, null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('33', '2', null, null, '86', '1', '核心优势', '1', '教学', 'Teaching', null, ' <p >\r\n                                <span>传承台湾优良的教学传统，延续特有的团班教学方式，保证原汁原味的高品质教学成效在中国少儿教育培训市场中完美体现。</span>\r\n                            </p>\r\n                            <p >\r\n                                透过音乐教学的方式，实现最前沿的“全人”教育理念，促进人格潜能的自由、充分、和谐、全面持续的发展，使教育过程不仅仅停留在知识的传递和技能的培训，更能关注内在情感体验以及人格、智能、技能的全面培养。坚持提供高档专业的教学环境也是Holistic玫苓全人音乐始终追求的条件保障，每间教室都拥有录音棚级别的专业化品质保证，满足家长和孩子对学习环境的高品质要求。\r\n                            </p>', '/images/advantage_4.png', '/images/advan_img_4.png', null, null, null, null, null, null, null, '1', null, null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('34', '2', null, null, '78', '1', '核心优势', '1', '商演', 'Retail', null, ' <p >\r\n                                <span>Holistic玫苓全人音乐常年受到邀请参与各类的大小型国际音乐表演，</span>给予孩子多样的世界级音乐熏陶，帮助开阔音乐世界的视野，增长见识，为孩子搭建对世界级舞台的认知与表演的桥梁。\r\n                            </p>\r\n                            <p >\r\n                                <span>\r\n                                    由平台主办多届的台湾梅苓杯国际木琴大赛也为来自海外各地的参赛选手提供了表现合作的机会，更接地气的拥有和世界级击乐大师交流学习的机遇。\r\n                                </span>\r\n                                二十多年与世界级音乐平台接轨的经验和资源，成就了许多担任国家级乐团中佼佼者的玫苓学子，获得了国内外音乐家的一致好评，是创造培育音乐人才的高端平台。\r\n                            </p>', '/images/advantage_5.png', '/images/advan_img_5.png', null, null, null, null, null, null, null, '1', null, null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('35', '2', null, null, '6', '1', '核心优势', '1', '零售', 'Performance', null, '  <p >\r\n                                目前<span>Holistic玫苓全人音乐常年受到邀请参与各类的大小型国际音乐表演，</span>不单供应玫苓教学中的教具要求，还满足了学者对乐器进阶的学习需求；面向市场上幼儿园、事业单位等机构的采购诉求，也能够准确及时地为其生产定制化Holistic玫苓全人音乐品牌乐器，全方位打造一体化标准生产和零售端口的多元渠道，是<span>\r\n                                能够满足高品质乐器要求的一站式订购平台，拥有从设计生产到教学零售的完整产业生态链，是在众多音乐教育品牌中脱颖而出的重要优势。\r\n                              </span>\r\n                            </p>', '/images/advantage_6.png', '/images/advan_img_6.png', null, null, null, null, null, null, null, '1', null, null, null, null, null, null);
