INSERT INTO `pc_gw` VALUES ('44', '3', null, null, '23', '0', 'musical', '1', '邦哥鼓', 'Bongo', null, ' <p >\r\n                           邦戈鼓，Bongo Drum，用手指弹奏的古巴黑人小型鼓，主要用於拉丁美洲舞蹈音乐之中。通常成对使用，用手指扣击, 用两个鼓，相隔5度，按C－G定音。邦戈鼓是古巴黑人音乐的节奏乐器。    \r\n                        </p>\r\n                        <p c>\r\n                           对大小不同的小型单面鼓，鼓面以动物皮制成,大的鼓能奏出低音，小的鼓能奏出较高的音。    \r\n                        </p>', '/images/courses_musical.png', null, null, null, null, null, null, null, null, '1', '1', null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('45', '3', null, null, '31', '0', 'musical', '1', '邦哥鼓', 'Bongo', null, ' <p >\r\n                           邦戈鼓，Bongo Drum，用手指弹奏的古巴黑人小型鼓，主要用於拉丁美洲舞蹈音乐之中。通常成对使用，用手指扣击, 用两个鼓，相隔5度，按C－G定音。邦戈鼓是古巴黑人音乐的节奏乐器。    \r\n                        </p>\r\n                        <p c>\r\n                           对大小不同的小型单面鼓，鼓面以动物皮制成,大的鼓能奏出低音，小的鼓能奏出较高的音。    \r\n                        </p>', '/images/courses_musical.png', null, null, null, null, null, null, null, null, '1', '2', null, null, null, null, null);
