INSERT INTO `pc_gw` VALUES ('54', '0', null, null, '12', '1', '全球优选', '0', '为孩子全球选优', '5A级教学师资', null, ' <p class=\"\">超过 <span>14,800</span> 名中外音乐专家</p>\r\n                    <p class=\"\">每天超过 <span>50,000</span> 节课程<br/> 大数据帮家长找到合适孩子的教学方式\r\n                    </p>\r\n\r\n                    <p class=\"\">超过 <span>14,800</span> 名中外音乐专家</p>\r\n                    <p class=\"\">每天超过 <span>50,000</span> 节课程<br/> 大数据帮家长找到合适孩子的教学方式\r\n                    </p>', '/images/Chalo%20Eduardo.png', null, null, null, null, null, null, null, null, '1', '1', null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('55', '5', null, null, '3', '0', '投资合作', '0', '投资合作', 'Inevstemt', null, ' <p>\r\n                43.7%的家庭重点关注孩子在应试科目的学习并兼顾适当考虑孩子的兴趣培养；有超过一半的家长更加注重孩子在综合素质方面的培养或将素质培养与应试教育放置在同等重要的位置。同时，调查显示，各种兴趣特长的培训班已经成为家长支出最多的项目，有71.4%的家长曾经为孩子支出过 相关费用。在中国将会有越来越多的年轻父母为孩子选择优质教育。\r\n\r\n            </p>\r\n            <p>\r\n                高手做势，中手做市，低手做事。作为正在寻找投资项目你，是站在巨人肩上，借助成功的模式和经验快速抢占市场并实现盈利，还是独自摸索，付出成倍的成本和精力，却事倍功半。\r\n            </p>', '/images/investment_banner.png', null, null, null, null, null, null, null, null, '1', null, null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('56', '5', '', '', '12', '0', '教育理念', '0', '国际先进的<span>2.0</span>全人教育理念<br>打破教育市场同质化', '<p> 拒绝教育模式<span>同质化</span><br> 保障投资收益            </p>', '', ' <p style=\"margin-top: 30px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; color: rgb(89, 87, 87); text-indent: 32px;\">面对行业竞争越来越专业化，对于初入行业的投资者来说，挑选严重同质化的项目是极其危险的决定，因为产品上又没有太多的独特优势，很难在如此激烈的竞争中生存下去。</p><p style=\"margin-top: 30px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; color: rgb(89, 87, 87); text-indent: 32px;\">来自台湾有25年历史的Holistic玫苓全人音乐秉承最前沿的“全人教育”理念，在健全人格的基础上，促进学生的全面发展，让个体生命的潜能得到自由、充分、全面、和谐、持续发展，培养学生成为<span style=\"font-weight: bold; color: rgb(253, 208, 0);\">有道德（人格）、有知识（智能）、有能力（技能）的“全人”</span>，满足客户对于课程品质和独特性的更高的要求。</p>', '/images/investment_img1.png', '/images/investment_img2.png', '', '', null, null, null, null, null, '1', null, null, null, '2018-08-19 23:19:56', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('57', '5', '', '', '3', '0', '我们的服务', '0', '我们的服务', 'Our Services', '', ' <p>\r\n                你需要知道的<span style=\"color: #fdd000;\">9大运营支持</span><br> 没有做过音乐教育怎么办？没有运营经验怎么办？<br>\r\n                <span>我们帮你！</span>\r\n            </p>', '/images/investment_bgimg1.png', '', '', '', null, null, null, null, null, '1', null, null, null, '2018-08-19 23:23:03', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('58', '5', '', '', '12', '0', '我们的优势', '0', '我们的优势', 'Our Advantages', '', '<p><span style=\"color: rgb(255, 255, 255); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 30px; font-weight: 700; letter-spacing: 2px; text-align: center; background-color: rgba(0, 0, 0, 0.8);\">假如你家有适龄孩子，你将会</span><span style=\"color: rgb(253, 208, 0); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 30px; font-weight: 700; letter-spacing: 2px; text-align: center;\">如何培养他/她？</span><br style=\"color: rgb(255, 255, 255); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 30px; font-weight: 700; letter-spacing: 2px; text-align: center;\"><span style=\"color: rgb(255, 255, 255); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 30px; font-weight: 700; letter-spacing: 2px; text-align: center; background-color: rgba(0, 0, 0, 0.8);\">你考虑的种种，</span><br style=\"color: rgb(255, 255, 255); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 30px; font-weight: 700; letter-spacing: 2px; text-align: center;\"><span style=\"color: rgb(255, 255, 255); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 30px; font-weight: 700; letter-spacing: 2px; text-align: center; background-color: rgba(0, 0, 0, 0.8);\">就是教育培训行业的投资核心。</span><br></p>', '/images/investment_bgimg2.png', '', '', '', null, null, null, null, null, '1', null, null, null, '2018-08-19 23:30:09', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('59', '6', '', '', '3', '0', '台湾梅苓', '0', '台湾梅苓', 'Taiwan', '', ' <p style=\"margin-top: 22px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; text-indent: 32px; font-size: 16px; color: rgb(89, 87, 87);\">1992年创办全台湾唯一的专业打击乐教学系统，以打击乐教学系统所需要的课程规划、教案设计、教材编篡出版、专业师资训练、业务发展、活动举办为主要的经营项目。</p><p style=\"margin-top: 22px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; text-indent: 32px; font-size: 16px; color: rgb(89, 87, 87);\">全人音乐教育强调「音乐教学」与「人格教育」并重。在音乐知识与技能之外，让孩子在与他人合奏互动的过程中，乃至团体演出的默契培养，了解自我优势，学习尊重、互助和群体价值。透过音乐的学习创造自信，建立正确的价值观。</p><p style=\"margin-top: 22px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; text-indent: 32px; font-size: 16px; color: rgb(89, 87, 87);\">教育是种「人」的事业。我们以这样的理念出发，设计适龄、适性、适量的课程系统，融合人格发展的教育，启发孩子从中学习与自己相处，并与他人互动。同时，我们的音乐教学作业与课程开发设计的能力，更是国内儿童音乐教学法课程首屈一指的音乐教学系统。</p><p style=\"margin-top: 22px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; text-indent: 32px; font-size: 16px; color: rgb(89, 87, 87);\">音乐是过程的累积，在这过程中的每一分每一秒，都是教育。坚持资格认证的专业讲师，以及全数合法立案的教室设备，是我们对于提供优质教学环境的负责保证。</p>', '/images/meiling_tw_banner.png', '/images/meiling_tw_logo.png', '/images/meiling_tw_w.png', '', null, null, null, null, null, '1', null, null, null, '2018-08-19 23:35:27', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('60', '6', '', '', '12', '0', '木琴大赛', '0', '木琴大赛', '/images/meiling_tw_icon1.png', '', '  <p style=\"margin-top: 10px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; color: rgb(114, 113, 113); font-size: 16px; text-indent: 32px; background-color: rgb(247, 248, 248);\">梅苓杯木琴大赛自2003年起于梅苓全人音乐教学系统举办第一届赛程，历经十三届的比赛，除了在系统内成为年度重要的活动指标，也吸引了各地许多对爱好木琴独奏的学子前来参赛.此大赛让参赛者彼此切磋、互相观摩及交流，鼓励并激发参赛者于琴艺技巧上精益求精。</p><p style=\"margin-top: 50px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; color: rgb(114, 113, 113); font-size: 16px; background-color: rgb(247, 248, 248);\">梅苓全人音乐希望通过木琴大赛：&nbsp;<br>(1)开拓视野，互相观摩，琴艺切磋&nbsp;<br>(2)提供参赛者独立展现自我的平台&nbsp;<br>(3)培养表演之礼仪与勇气&nbsp;<br>(4)培养比赛健康心态，超脱胜败得失之心&nbsp;<br>(5)建立目标，培养负责任的态度&nbsp;<br>(6)提升木琴的敲奏技巧&nbsp;<br>(7)学习面对挑战，克服自我的瓶颈&nbsp;<br>(8)增进亲子同侪间的互动与交流&nbsp;<br>(9)累积表演舞台经验&nbsp;<br>(10)学习赞美、肯定自己与他人&nbsp;</p>', '/images/meiling_tw_img1.png', '/images/meiling_tw_img1.png', '', '', null, null, null, null, null, '1', null, null, null, '2018-08-19 23:36:36', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('61', '6', '', '', '23', '0', '击乐嘉年华', '0', '击乐嘉年华', '/images/meiling_tw_icon2.png', '', ' <p style=\"margin-top: 30px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; color: rgb(114, 113, 113); font-size: 16px; text-indent: 32px;\">一年一度最精采的年度盛事-梅苓击乐嘉年华，是台湾打击乐界的注目焦点，不但因为梅苓打击乐团的团员各个实力超强，近年来在国内外各大赛场上屡获佳绩，有超乎其他同龄同侪的表现；更因为平日的团练累积的能量，令人期待每年度这些年轻的击乐家又会创造出何等炫丽的风采与魅力呢!</p><p style=\"margin-top: 30px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; color: rgb(114, 113, 113); font-size: 16px; text-indent: 32px;\">这场大型打击乐合奏音乐会以多元的各类打击乐器家族呈献敲击、演奏出美妙独特的乐音，更可在这场盛会中听到合奏的细致、回旋、激荡。年年追求突破的梅苓打击乐团在每个年度都会精心策划诚挚邀集国际上高知名度的大师来台共襄盛举，细数这几年曾邀请美国的击乐大师Chalo Eduardo及台湾御鼓坊艺术总监陈文吉老师担任特别嘉宾参与演出；又曾邀请甫荣获年度比利时大奖的奥地利击乐家Sebastian Efler来台交流演出，以及台湾唯一专注于「当代行进乐」的台北乐府热情演出；或是加入魔术、B-BOX、阿卡贝拉人声乐团…等使整场音乐性增添丰富与多层次。</p>', '/images/meiling_tw_img2.png', '/images/meiling_tw_img2.png', '', '', null, null, null, null, null, '1', null, null, null, '2018-08-19 23:37:33', '超级管理员', null);
