INSERT INTO `pc_gw` VALUES ('66', '0', null, null, '3', '1', '教育愿景', '0', '玫苓教育愿景', '透过音乐让孩子一生与美好在一起！', null, ' <p class=\"mt70\">26年来致力于优秀的全人教育推向世界每一个家庭。让各国的孩子都可以接受到最具包容性的世界音乐文化以及最专业的音乐课程。</p>\r\n                        <p>我们号召对音乐教育充热爱的志同道合的伙伴们共同为梦想而战斗，我们期待您的加入！</p>', null, null, null, null, null, null, null, null, null, '1', '1', null, null, null, null, null);
