INSERT INTO `pc_gw` VALUES ('68', '5', '', '', '3', '0', '国际品牌', '0', '01', '<p>优选国际品牌 <br> 赢在起点</p>', '', ' <p style=\"margin-top: 56px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; color: rgb(89, 87, 87); font-size: 16px; text-indent: 32px;\">Holistic玫苓全人音乐教学系统创始于西年1992年，是集课程开发与音乐教学设计于一体，是亚洲地区唯一通过英国权威ITA国际组织ISO9001认证，汇聚音乐美学与完整人格兼具的国际优质教学系统。目前教学足迹已遍及台湾、美国、日本、新加坡、马来西亚、维也纳等多个国家及地区。</p><p style=\"margin-top: 32px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; color: rgb(89, 87, 87); font-size: 16px; text-indent: 32px;\">2015年进入中国，是目前国内教学体系最完整、师资力量最强大、乐器种类最齐全、教学环境最高端的音乐教育品牌。</p><p style=\"margin-top: 32px; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; color: rgb(89, 87, 87); font-size: 16px; text-indent: 32px;\">系统秉持「音乐」就是一种最好的全人教育，强调「音乐教学」与「人格教育」并重，除了乐理知识外，更将人格教育导入课程之中，藉由团班式的模仿学习，建立孩子的人际互动关系，开拓孩子的学习视野。循序渐进的让孩子了解自己、找到自己的优势，更懂得如何去欣赏别人。</p>', '/images/investment_img7.png', '', '', '', null, null, null, null, null, '1', null, null, null, '2018-08-19 23:30:42', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('69', '5', null, null, '12', '0', '教室环境', '0', '02', '<p>录音棚级专业教室环境 <br>大空间 高回报</p>', null, '  <table class=\"table\" border=\"1\">\r\n                            <tr>\r\n                                <th class=\"t\">&nbsp;</th>\r\n                                <th class=\"t\">Holistic</th>\r\n                                <th class=\"t\">传统音乐培训</th>\r\n                            </tr>\r\n                            <tr>\r\n                                <th>门店面积</th>\r\n                                <td>300㎡</td>\r\n                                <td>300㎡</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <th>教室数量</th>\r\n                                <td>3间大教室</td>\r\n                                <td>6间小教室</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <th>教学方式</th>\r\n                                <td>团班</td>\r\n                                <td>个别</td>\r\n                            </tr>\r\n\r\n                            <tr>\r\n                                <th>老师数量</th>\r\n                                <td>3人</td>\r\n                                <td>6人</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <th>单课时学员数</th>\r\n                                <td>36人</td>\r\n                                <td>6人</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <th>单课时收益</th>\r\n                                <td>3600元</td>\r\n                                <td>1200元</td>\r\n                            </tr>\r\n                            <tr>\r\n                                <th>盈利课时线</th>\r\n                                <td>13.89课时</td>\r\n                                <td>41.67课时</td>\r\n                            </tr>\r\n                        </table>', '/images/investment_img3.png', '/images/investment_img4.png', null, null, null, null, null, null, null, '1', null, null, null, null, null, null);
