INSERT INTO `pc_gw` VALUES ('72', '5', '', '', '3', '0', '学习周期', '0', '05', '<span>课程学习周期长 <br> 续课率行业领先</span>', '', ' <p><span style=\"font-size: 20px; color: rgb(253, 208, 0); font-weight: bold; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; background-color: rgb(247, 248, 248);\">5阶</span><span style=\"color: rgb(89, 87, 87); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; background-color: rgb(247, 248, 248);\">专业音乐课程</span><br style=\"color: rgb(89, 87, 87); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; background-color: rgb(247, 248, 248);\"><span style=\"color: rgb(89, 87, 87); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; background-color: rgb(247, 248, 248);\">提供学员至少</span><span style=\"font-size: 20px; color: rgb(253, 208, 0); font-weight: bold; font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; background-color: rgb(247, 248, 248);\">6</span><span style=\"color: rgb(89, 87, 87); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; background-color: rgb(247, 248, 248);\">年的长跨度持续教学</span><br style=\"color: rgb(89, 87, 87); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; background-color: rgb(247, 248, 248);\"><span style=\"color: rgb(89, 87, 87); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; background-color: rgb(247, 248, 248);\">大大提高单个客户开发度及收益周期</span><br></p>', '/images/investment_img5.png', '/images/investment_img6.png', '', '', null, null, null, null, null, '1', null, null, null, '2018-08-19 23:32:45', '超级管理员', null);
