INSERT INTO `pc_gw` VALUES ('74', '5', null, null, '3', '0', '投资要求', '0', ' 投资要求', 'Requirement', null, '  <ul>\r\n                            <li>1. 认同Holistic品牌及文化；</li>\r\n                            <li>2. 有一定资金实力，有开展各种市场活动的能力；</li>\r\n                            <li>3. 有能力、有责任心、有毅力的创业者；</li>\r\n                            <li>4. 拥有或能组织一定规模稳定的专业团队；</li>\r\n                            <li>5. 管理者具备对当地市场的预估、协调、掌控能力；</li>\r\n                            <li>6. 最好拥有一定高端客户资源或媒体资源；</li>\r\n                            <li>7. 热爱儿童教育事业，能亲自参与筹备。</li>\r\n                        </ul>', null, null, null, null, null, null, null, null, null, '1', null, null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('75', '6', '', '', '12', '0', '专家赠言列表', '1', 'Chalo Eduardo', '美国著名音乐家', '', '<span style=\"color: rgb(114, 113, 113); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; text-indent: 32px;\">「感動」是在擔任梅苓盃木琴大賽評審的過程中，不斷出現在我心中的感受。不論是充滿勇氣與活力的小小參賽者到經驗豐富與熱情的大孩子們，在比賽時對木琴演奏的展現及技術的表現都令人難忘。每一位參賽選手都作好充分的準備，享受舞台美妙的演奏時刻... ...</span>', '/images/talk_posone1.png', '', '', '', null, null, null, null, null, '1', '3', null, null, '2018-08-19 23:40:33', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('76', '6', '', '', '23', '0', '专家赠言列表', '1', 'Chalo Eduardo', '美国著名音乐家', '', '<span style=\"color: rgb(114, 113, 113); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; text-indent: 32px;\">很荣幸能够受邀到台湾梅苓击乐嘉年华演出。同时我也参与并观赏梅苓团员们的精采击乐表演。我非常惊艳这群孩子们如此高水平的舞台呈现。梅苓系统培育出的孩子充满纪律、拥有团队合作的精神，再再更肯定系统的教育方式，同时也成功的激励孩... ...</span>', '/images/talk_posone2.png', '', '', '', null, null, null, null, null, '1', '2', null, null, '2018-08-19 23:40:22', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('77', '6', '', '', '31', '0', '专家赠言列表', '1', 'Chalo Eduardo', '美国著名音乐家', '', '<span style=\"color: rgb(114, 113, 113); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; text-indent: 32px;\">我很高兴有机会来梅苓全人音乐教学系统与大家分享日本太鼓。在教学的同时也受益良多，正是所谓教学相长，让我觉得非常充实而有意义!太鼓的表现是由简单的节奏语言所构成，但是透过我们从心里出发而演奏出来的音乐是最有生命力的。希望在不久的将来我们还有机会一起演奏，再次感谢!</span>', '/images/talk_posone3.png', '', '', '', null, null, null, null, null, '1', '1', null, null, '2018-08-19 23:40:10', '超级管理员', null);
INSERT INTO `pc_gw` VALUES ('78', '6', '', '', '12', '0', '专家赠言列表', '1', 'Chalo Eduardo', '美国著名音乐家', '', '<span style=\"color: rgb(114, 113, 113); font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; text-indent: 32px;\">在30多年乐此不疲的音乐演奏生涯中，我曾与卡洛斯山塔那(知名吉他演奏家)、瑞奇马汀(知名流行歌手)、Gloria Estefan(知名歌手)…等各界优秀的音乐人合作过，我们在音乐中相互启发、相互影响，更形塑出现在的我。</span><br>', '/images/talk_posone4.png', '', '', '', null, null, null, null, null, 'del', '0', null, null, '2018-08-19 23:39:57', '超级管理员', null);
