INSERT INTO `pc_gw` VALUES ('84', '5', null, null, '12', '0', '我们的服务2', '1', '全方位品牌宣传', 'Comprehensive brand support', null, ' <p>\r\n                                    与CCTV，新浪，凤凰网，腾讯网等已建立长期合作关系，授权使用国家商务部信用企业认证证书 CCTV-7，腾讯视频，搜狐，优酷，土豆，爱奇艺等企业展播，全国700+家市县电视台广播&amp;电视联播\r\n                                </p>', '/images/investment_iconC.png', null, null, null, null, null, null, null, null, '1', null, null, null, null, null, null);
INSERT INTO `pc_gw` VALUES ('85', '5', '', '', '23', '0', '经营扶持', '0', '<span>保姆式</span>经营扶持&nbsp;&nbsp;&nbsp;为投资保驾护航', '', '', ' <p style=\"font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; color: rgb(89, 87, 87); text-indent: 32px;\">传统的教育投资人多数运营经验不足，<span style=\"color: rgb(253, 208, 0); font-weight: bold;\">常常只重视挑选优质的课程内容</span>，虽然这是创业成功最为直接有效的方式，但是<span style=\"color: rgb(253, 208, 0); font-weight: bold;\">选址、装修、招聘、推广、管理、运营、售后等一系列经营的问题也都是对投资人巨大的考验</span>，如果品牌不能为投资人有效避免，将会导致投入成本无限增加，经营风险暴增。</p><p style=\"font-family: &quot;Microsoft YaHei&quot;, 微软雅黑; font-size: 16px; color: rgb(89, 87, 87); text-indent: 32px;\">真正有实力的国际品牌，不仅仅是课程上有独特优势，在投资人的经营扶持上<span style=\"color: rgb(253, 208, 0); font-weight: bold;\">专业化、多元化、保姆式</span>才可以让真正参与投资人<span style=\"color: rgb(253, 208, 0); font-weight: bold;\">节省成本、降低风险，在面临突发事件时可以通过品牌总部的有力支持来进行互补，保证有全面性地收入</span>，而不至于中断现金流，让自己可以比较从容面对，不至于惊慌失措。</p>', '', '', '', '', null, null, null, null, null, '1', null, null, null, '2018-08-19 23:28:43', '超级管理员', null);
