INSERT INTO `pc_gw` VALUES ('101', '4', null, null, '12', '1', '活动预告', '1', '第十四届台湾梅苓杯木琴大赛圆满落幕1', '第十四届台湾梅苓杯木琴大赛圆满落幕', '22018年7月23日，第十四届台湾梅苓杯目前大赛在台北市艺术中心圆满落下帷幕018年7月23日，第十四届台湾梅苓杯目前大赛在台北市艺术中心圆满落下帷幕', '<p class=\"one-p\">看完《小偷家族》后，有两个印象深刻的镜头，一是一家人在海滩上留下的<strong>背影</strong>，一是一家人蜗居在陋室的屋檐下捕捉上空的<strong>烟火</strong>。</p>\r\n            <p class=\"one-p\">果然，中国版海报抓住了这两个瞬间，设计出了令日本网友也纷纷转发点赞的海报。</p>\r\n            <p class=\"one-p\"><img src=\"//inews.gtimg.com/newsapp_bt/0/4798758680/1000\" class=\"content-picture\"></p>\r\n            <p class=\"one-p\">海边背影</p>\r\n            <p class=\"one-p\"><img src=\"//inews.gtimg.com/newsapp_bt/0/4798758681/1000\" class=\"content-picture\"></p>\r\n            <p class=\"one-p\">观看烟火</p>\r\n            <p class=\"one-p\">尤其是第一张，深得老夫心意，一把大伞，呵护着家庭，将原本支离破碎的个体笼罩在一片祥和之下。</p>\r\n            <p class=\"one-p\">位于视觉中心的则是五个牵手迎接前浪的背影，简直温馨如常！仅仅是一个画面，竟能让人听见海浪声和欢笑声呢。</p>\r\n            <p class=\"one-p\">电影原装画面如下，这波羡煞人心的背影杀，我给满分！</p>\r\n            <p class=\"one-p\"><img src=\"//inews.gtimg.com/newsapp_bt/0/4798758682/1000\" class=\"content-picture\"></p>\r\n            <p class=\"one-p\">然而，这并不是枝裕和在电影里第一次使用背影杀技能了，<strong>他电影中最动人的瞬间，几乎都使用人物背影表现</strong>，可谓一个真正的背影杀爱好者。</p>\r\n            <p class=\"one-p\">2016年上映的<strong>《比海更深》</strong>最后一个镜头：</p>\r\n            <p class=\"one-p\"><img src=\"//inews.gtimg.com/newsapp_bt/0/4798758683/1000\" class=\"content-picture\"></p>\r\n            <p class=\"one-p\">（影片插曲来自邓丽君1987年6月21日发表的日文单曲《别れの予感》）</p>\r\n            <p class=\"one-p\">原本分道扬镳的夫妻领着孩子从母亲家走出，构成了整部影片最为温馨的一个画面，母亲的一句话“自己到这把年纪了，还没说过爱过谁比海还深”点出了影片题名。</p>\r\n            <p class=\"one-p\">2015年的<strong>《海街日记》</strong>是一部以葬礼开始，又以葬礼结束的电影。</p>\r\n            <p class=\"one-p\"><img src=\"//inews.gtimg.com/newsapp_bt/0/4798758684/1000\" class=\"content-picture\"></p>\r\n            <p class=\"one-p\">同父异母的姐妹初见，在一个可以望见小镇的山坡上第一次彼此敞开心扉，一个暖心的背影杀镜头袭来！</p>\r\n            <p class=\"one-p\">再一次经历人生最终告别的姐妹们徒步在海边，电影结束，依然用背影表现。</p>\r\n            <p class=\"one-p\"><img src=\"//inews.gtimg.com/newsapp_bt/0/4798758685/1000\" class=\"content-picture\"></p>\r\n            <p class=\"one-p\">2008年的<strong>《步履不停》</strong>，一位白发苍苍的老头子在妻女择菜声中走出了家门。</p>\r\n            <p class=\"one-p\"><img src=\"//inews.gtimg.com/newsapp_bt/0/4798758686/1000\" class=\"content-picture\"></p>\r\n            <p class=\"one-p\">家族里最年轻的一代用手触摸着高处的绽放的紫薇花，由于太矮，有些吃力。</p>\r\n            <p class=\"one-p\"><img src=\"//inews.gtimg.com/newsapp_bt/0/4798758687/1000\" class=\"content-picture\"></p>\r\n            <p class=\"one-p\">将近两个小时的影片讲述了2天内发生的故事，最后，导演安排父母在登山路上走完了生命的路程。</p>', '/images/wenzhang.png', null, null, null, null, null, null, '2018-08-23', null, '1', '1', '2018-08-23 00:00:00', null, null, null, null);
