INSERT INTO `pc_gw` VALUES ('134', '5', null, null, '12', '0', '口碑见证list', '1', '吕先生', '原早教投资人', null, '  <p>\r\n                                    不知不觉我经营的早教中心已经拥有不少小会员，在朋友眼中我是一个非常成功的投资人，但是现在早教竞争异常激烈，一个孩子数据成本要200多元，可也就1次消费，这让我天天面对找新生的痛苦，加上常常都有孩子请假、缺课的情况，出勤率不高。对我而言是着赚现金流不赚利润的尴尬，为此不断在寻求解决的方案，直到在厦门遇见玫苓。展会上特别的乐器、有趣的音符卡、音乐CD、满满50多本的课程教材让我兴奋不已，25年的历史，在系统中超过4年以上的上课学员居然有70%以上，不仅可以按课程收费，学员几年下来还系统购买不少乐器。在详细的考察了厦门门店实际营业额、出勤和续费率后我毫不犹豫加盟了，现在我自己的门店不仅仅是本地独一无二的，而且还把我早教辛苦经营积攒下来的生源完美的嫁接到了玫苓的平台上，感谢玫苓提供了如此优秀的平台，让我的事业又向前迈进了一步。\r\n                                </p>', '/images/investment_Psonimg1.png', null, null, null, null, null, null, null, null, '1', '1', null, null, null, null, null);
